using CCBlade
import NLsolve
using LinearAlgebra: norm


function residual1(phi, rotor, section, op)
    R, outputs = CCBlade.residual(phi, rotor, section, op)
    if rotor.turbine  # negate so it stays in propeller perspective for this demo
        outputs = Outputs(-outputs.Np, -outputs.Tp, -outputs.a, -outputs.ap, -outputs.u, -outputs.v, outputs.phi, -outputs.alpha, outputs.W, -outputs.cl, outputs.cd, -outputs.cn, -outputs.ct, outputs.F, outputs.G)
    end
    return R, outputs
end

function solve1(rotor, section, op)
    outputs = CCBlade.solve(rotor, section, op)
    if rotor.turbine  # negate so it stays in propeller perspective for this demo
        outputs = Outputs(-outputs.Np, -outputs.Tp, -outputs.a, -outputs.ap, -outputs.u, -outputs.v, outputs.phi, -outputs.alpha, outputs.W, -outputs.cl, outputs.cd, -outputs.cn, -outputs.ct, outputs.F, outputs.G)
    end
    return outputs
end

function residual2(as, aps, rotor, section, op)

    phi = atan((1 + as)*op.Vx/((1 - aps)*op.Vy))
    _, outputs = residual1(phi, rotor, section, op)
    
    R = [outputs.a - as; 10*(outputs.ap - aps)]

    return R, outputs

end


function solve2(rotor, section, op)

    # ----- solve residual function ------    

    # wrapper to residual function
    R(x) = residual2(x[1], x[2], rotor, section, op)[1]

    a0 = -1.0/3
    ap0 = -0.1
    x0 = [a0; ap0]  

  
    results = NLsolve.nlsolve(R, x0, method=:trust_region, ftol=1e-14, autodiff=:forward)
    x = results.zero
    
    _, outputs = residual2(x[1], x[2], rotor, section, op)

    return outputs
end




